def binary_search(arr, target):
    low = 0
    high = len(arr) - 1

    while low <= high:
        mid = (low + high) // 2

        if arr[mid] == target:
            return mid

        elif arr[mid] < target:
            low = mid + 1

        else:
            high = mid - 1

    return -1

class Queue:
    def __init__(self):
        self.stack1 = []
        self.stack2 = []

    def empty(self):
        return (len(self.stack1) == 0 and len(self.stack2) == 0)

    def enqueue(self, item):
        if self.empty():
            self.stack1.append(item)
            self.stack2.append(None)
        else:
            self.stack2.append(item)

    def dequeue(self):
        if not self.empty():
            if self.stack1[-1] == None:
                item = self.stack2[-1]
                self.stack2.pop()
                self.stack1.append(item)
            else:
                self.stack1.pop()
                self.stack2.pop()

